import image1 from '././testimonials/1.png';
import image2 from '././testimonials/2.png';
import image3 from '././testimonials/3.png';

class Work extends Component {
  constructor() {
    super();}
  render(){
    return (
      <div>
        <h1 className="pa3 ml3">Projects completed </h1>
         <div className="bb bw2 center " ></div>
         <div>
        <div className="bg-light-green dib br3 pa3 ma2 grow">
        <img src={image1} alt="project sharva" width="280px" height="280px"/>
        <h6>Our website ........</h6>
        <button type="button" className="f6 link dim ph3 pv2 mb2 dib white bg-cyan"><a href="">View website</a></button>
        </div>
        <div></div>
        <div></div>
        </div>
      </div>
    );
  }
}
export default Work;
